max-width: 1000px;
    height: 250vh;
    background-color: black;
}`;

const Left=styled.div``;

const Right= styled.div``;

const Row=styled.div``;

const Howitworks = () => {
    return (
        <>
        <Conatiner >
            <Row>
                <Left>Left</Left>
                <Right>Right</Right>
            </Row>
        </Conatiner>
    </>
        )
}

export default Howitworks
